### Ethereum Blockchain Messenger Smart Contract

Below is a Solidity smart contract that meets the requirements:

```solidity
pragma solidity ^0.8.0;

contract BlockchainMessenger {
    // Mapping of message IDs to their respective message data
    mapping (uint256 => Message) public messages;

    // Mapping of message IDs to their respective update counts
    mapping (uint256 => uint256) public updateCounts;

    // Mapping of message IDs to their respective authors
    mapping (uint256 => address) public authors;

    // Mapping of message IDs to their respective timestamps
    mapping (uint256 => uint256) public timestamps;

    // Event emitted when a new message is saved
    event NewMessage(uint256 indexed messageId, string message, address author);

    // Event emitted when a message is updated
    event MessageUpdated(uint256 indexed messageId, string message, address author);

    // Struct to represent a message
    struct Message {
        string message;
        uint256 updateCount;
    }

    // Function to save a new message
    function saveMessage(string memory _message) public {
        // Generate a unique message ID
        uint256 messageId = uint256(keccak256(abi.encodePacked(_message)));

        // Create a new message struct
        Message memory newMessage = Message(_message, 0);

        // Save the message
        messages[messageId] = newMessage;

        // Update the author and timestamp
        authors[messageId] = msg.sender;
        timestamps[messageId] = block.timestamp;

        // Emit the NewMessage event
        emit NewMessage(messageId, _message, msg.sender);
    }

    // Function to update an existing message
    function updateMessage(uint256 _messageId, string memory _newMessage) public {
        // Check if the message exists
        require(messages[_messageId].message != "", "Message does not exist");

        // Check if the caller is the author
        require(authors[_messageId] == msg.sender, "Only the author can update the message");

        // Update the message
        messages[_messageId].message = _newMessage;

        // Increment the update count
        updateCounts[_messageId]++;

        // Update the timestamp
        timestamps[_messageId] = block.timestamp;

        // Emit the MessageUpdated event
        emit MessageUpdated(_messageId, _newMessage, msg.sender);
    }

    // Function to get a message by ID
    function getMessage(uint256 _messageId) public view returns (string memory, uint256, address, uint256) {
        // Check if the message exists
        require(messages[_messageId].message != "", "Message does not exist");

        // Return the message data
        return (messages[_messageId].message, updateCounts[_messageId], authors[_messageId], timestamps[_messageId]);
    }
}
```

